import axios from "axios";

const UTILISATEUR_REST_URL = "http://localhost:8080/api/utilisateur/";

class UtilisateurService {
    addUtilisateur(utilisateur) {
        return axios.post("http://localhost:8080/api/utilisateur/", utilisateur);
    }
}

export default UtilisateurService;
